import * as React from "react";
import { Image } from "expo-image";
import { StyleSheet, Text, View } from "react-native";
import { Button } from "react-native-paper";
import { useNavigation } from "@react-navigation/native";

const IPhone141 = () => {
  const navigation = useNavigation();

  return (
    <View style={[styles.iphone141, styles.frameFlexBox]}>
      <View style={[styles.frame, styles.frameFlexBox]}>
        <Image
          style={styles.screenshot20230907At1045}
          contentFit="cover"
          source={require("../assets/screenshot-20230907-at-1045-1.png")}
        />
        <Text style={styles.createABundle}>Create a Bundle</Text>
      </View>
      <Button
        style={[styles.frame1, styles.frameFlexBox]}
        mode="contained"
        labelStyle={styles.frameBtn}
        onPress={() => navigation.navigate("IPhone142")}
        contentStyle={styles.frameBtn1}
      >
        Get Started
      </Button>
    </View>
  );
};

const styles = StyleSheet.create({
  frameBtn: {
    color: "#fff",
    fontSize: 15,
    fontWeight: "700",
    fontFamily: "Inter-Bold",
  },
  frameBtn1: {
    height: 118,
    width: 386,
  },
  frameFlexBox: {
    alignItems: "center",
    overflow: "hidden",
  },
  screenshot20230907At1045: {
    width: 100,
    height: 106,
  },
  createABundle: {
    alignSelf: "stretch",
    fontSize: 28,
    letterSpacing: 0.1,
    fontWeight: "600",
    fontFamily: "Inter-SemiBold",
    color: "#14304a",
    textAlign: "center",
    marginTop: 123,
  },
  frame: {
    width: 386,
    height: 263,
    justifyContent: "center",
  },
  frame1: {
    marginTop: 287,
  },
  iphone141: {
    backgroundColor: "#fafafa",
    shadowColor: "rgba(0, 0, 0, 0.25)",
    shadowOffset: {
      width: 0,
      height: 4,
    },
    shadowRadius: 4,
    elevation: 4,
    shadowOpacity: 1,
    flex: 1,
    width: "100%",
    paddingLeft: 3,
  },
});

export default IPhone141;
